import React, { useState } from 'react';
import { Navigate } from 'react-router';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { useLocation } from 'react-router-dom';
import { useHistory } from 'react-router-dom';
const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #488aee; /* 배경색 설정 */
  padding: 20px; /* 적절한 패딩 추가 */
  min-height: 100vh;
  
`;

const LogoImage = styled.img`
  width: 400px; /* 큰 로고 크기 */
  height: auto;
  margin-top: 0px;
  margin-bottom: 0px;
`;

const InputContainer = styled.div`

  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 20px;
  
`;

const Input = styled.input`

  width: 300px;
  height: 40px;
  margin-bottom: 30px;
  margin-top: 30px;
  padding: 10px;
  border-radius: 200px;
  border: none;
  box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.4);
  
`;


const RoundedBox = styled.div`
  border-radius: 200px;
  width:700px;
  height:800px;
  padding: 70px;
  background-color: #91B9F5; /* 배경색 설정 */
  box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2); /* 그림자 효과 */
  margin-top: 50px;
  
`;
const SignUpButton = styled.button`
display: block;
width: 200px; /* 버튼이 컨테이너의 가로 길이를 가지도록 함 */
background-color: #0066ff;
color: white;
border: none;
border-radius: 200px;
padding: 10px 20px;
font-size: 16px;
cursor: pointer;
box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2);
margin-top:20px;
`;

const BackButton = styled.button`
display: block;
width: 200px; /* 버튼이 컨테이너의 가로 길이를 가지도록 함 */
background-color: #0066ff;
color: white;
border: none;
border-radius: 200px;
padding: 10px 20px;
font-size: 16px;
cursor: pointer;
box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2);
margin-top:20px;
`;



const logobuife = '/info.png';


const SignUp3 =()=> {
  const location = useLocation();
  const userID = location.state?.userID || '';
  const [verificationCode, setVerificationCode] = useState('');
  const [error, setError] = useState('');


  const handleSubmit = async () => {
    try {
      const response = await fetch('https://port-0-server-cloudtype-4fju66f2clmyxbee6.sel5.cloudtype.app/members/new/emailCheck?code=' + verificationCode);
      const data = await response.json();

      if (response.ok) {
        // API로부터 응답을 받아 인증 확인
        if (data.success) {
          // 인증 성공 - 회원가입 완료
          alert('회원가입이 완료되었습니다!');
          // 회원가입이 성공했으면 다음 페이지로 이동
          history.push('/loginform');
          // 예시로 '/'로 이동하는 코드입니다.
          // 실제 프로젝트에서는 다른 페이지로 이동해야 합니다.
        } else {
          // 인증 실패 - 에러 메시지 표시
          setError('인증번호가 일치하지 않습니다.');
        }
      } else {
        // 응답이 실패한 경우
        setError('서버에서 오류가 발생했습니다.');
      }
    } catch (error) {
      // 오류 처리
      setError('서버와 통신 중 오류가 발생했습니다.');
    }
  };
 return (
   <div className="App">
     <div className="mainpage">
       
       <div className="mainbox">
        <Container>
          <RoundedBox>
          <Link to="/.">
            <LogoImage src={logobuife} alt="Buife 로고" />
          </Link>

        
            <InputContainer>

            <p>인증번호가 {userID}으로 전송되었습니다. 인증번호 8자리를 아래에 입력해주세요.</p>
            <Input
             type="text" 
             placeholder="인증번호 입력"
             value={verificationCode}
             onChange={(e) => setVerificationCode(e.target.value)}
            />
             {error && <p>{error}</p>}
                    <SignUpButton 
                    type="button"
                    className="signupButton"
                    onClick={handleSubmit}
                    >회원가입
                    </SignUpButton>
                    
                    <Link to="/signup2">
                    <BackButton type="button"
                    className="BackButton">뒤로가기
                    </BackButton>
                    </Link>

            </InputContainer>
        
          </RoundedBox>
         </Container>
       </div>
     </div>
   </div>
 );
}



export default SignUp3;
